import { useWallet } from "@solana/wallet-adapter-react";
import React, { useEffect, useState } from "react";
import "./Sidewallet.css";
import { LAMPORTS_PER_SOL, PublicKey } from "@solana/web3.js";
import { useConnection } from "@solana/wallet-adapter-react";
import {
  WalletModalProvider,
  WalletDisconnectButton,
  WalletMultiButton,
} from "@solana/wallet-adapter-react-ui";
import { Page, ExchangeField } from '../../components'
import styled from 'styled-components';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faExchangeAlt } from '@fortawesome/free-solid-svg-icons'
import StepWizard from "react-step-wizard";
import SAS from '../../components/sas';
import SuccessSwap from '../../components/success-swap-page';
import { DemoBalanceContext } from '../../context/demo-accounts'

const request = require("axios");
const ExchangeDivider = styled.div`
    position:relative;
    padding:0.7rem 0;
    text-align:center;
    button{
        height: 32px;
        width: 32px;
        border-radius: 50%;
        background: #000829;
        cursor: pointer;
        border: 0px;
        color: #fff;
        font-size: 12px;
        svg{
            transform: rotate(90deg);
        }   
    }
`;
import { useTranslation } from 'react-i18next';

function SideWallet() {
  const [totalArcedeTokens, setTotalArcedeTokens] = useState(0);
  const [balance, setBalance] = useState(0);
  const [walletAddress, setWalletAddress] = useState("XXXXXXXXXXXXXXXX");
  const [copyAddressStatus, setCopyAddressStatus] = useState("Copy Address");
  const { publicKey } = useWallet();
  const { connection } = useConnection();

  const TOKEN_PROGRAM_ID = new PublicKey(
    "TokenkegQfeZyiNwAJbNbGKPFXCWuBvf9Ss623VQ5DA"
  );

  useEffect(() => {
    if (publicKey) {
      connection
        .getTokenAccountsByOwner(
          new PublicKey(new PublicKey(publicKey.toBase58())),
          {
            programId: TOKEN_PROGRAM_ID,
          }
        )
        .then((res) => {
          res.value.map((item) => {
            connection
              .getParsedAccountInfo(new PublicKey(item.pubkey.toBase58()))
              .then((res) => {
                const tokenAddress = res.value.data.parsed.info.mint;
                //Arcade token address
                const arcadeAddress =
                  "tToKcFtUUQvDqSWbqpEhvgXwTMzWNx7mDpvxKLALrkY";
                if (tokenAddress === arcadeAddress) {
                  setTotalArcedeTokens(
                    res.value.data.parsed.info.tokenAmount.uiAmount
                  );
                  setWalletAddress(res.value.data.parsed.info.owner);
                  setBalance(res.value.lamports / LAMPORTS_PER_SOL);
                }
              })
              .catch(() => setTotalArcedeTokens(0));
          });
        })
        .catch(() => setTotalArcedeTokens(0));
    } else {
      setTotalArcedeTokens(0);
      setBalance(0);
      setWalletAddress("XXXXXXXXXXXXXXXX");
    }
  }, [publicKey]);

  const {t} = useTranslation()

    const [ArcadeTokenAccounts, setArcadeTokenAccounts] = useState({ arcade: 0, xarcade: 0 });
    async function getAccountBalances() {
        const res = await request.get('http://api.private.arcade2earn.io/api/demo/wallet/RCade47ZKErNcQB1CgkpEZUEmyfsqi2qh21mSCWASgm')
        setArcadeTokenAccounts(res.data)
    }
    const [currency, setCurrency] = useState({
        from: "ARCADE",
        to: 'xARCADE'
    })
    const [direction, setDirection] = useState(false)
    const [amount, setAmount] = useState(0);
    

    const asdf = useEffect(async () => {
        await getAccountBalances();
        return 0;
    }, []);

  return (
    <div
      className="offcanvas offcanvas-end second "

      id="offcanvasRight"
      aria-labelledby="offcanvasRightLabel"
      style={{ zIndex: "9999", backgroundColor: "#1f2127" }}
    >
      <div className="offcanvas-header ">
        <h5 className="first" id="offcanvasRightLabel">
          <img
            src="data:image/svg+xml;base64,"
            alt=""
          />{" "}
          Wallet
        </h5>
        <button
          type="button"
          className="btn-close text-reset"
          data-bs-dismiss="offcanvas"
          aria-label="Close"
        >
          <i className="bi bi-x-lg" style={{ color: "white" }}></i>
        </button>
      </div>
      <div className=" bgcol first p-4 ">
        <div
          className="d-flex justify-content-between"
          style={{ fontSize: "1.5rem", marginBottom: "3rem", color: "white" }}
        >
          <div
            className="address"
            data-bs-toggle="addressCopy"
            data-bs-placement="bottom"
            title={copyAddressStatus}
            style={{ display: "flex", justifyContent: "left" }}
            onMouseDown={() => {
              setCopyAddressStatus("Copied");
            }}
            onMouseUp={() => setCopyAddressStatus("Copy Address")}
          >
            
          <WalletMultiButton />
          </div>
          <button 
          type="button"
          className="small"
          style={{
            backgroundColor: "transparent",
            color:"white",
            border: "none",
          }}
          >
          <h5 className="small">Send ARCADE</h5>
          </button>
        </div>
        
        <div className="d-flex  justify-content-center justify-content-center align-items-center p-3 gap-2">
          <div>
            <h1 className="text-white">{ArcadeTokenAccounts.arcade}</h1>
          </div>
          <div className="polygon-circle" style={{backgroundColor:"none; !important"}}>
            <img 
              src="data:image/png;base64,"
              alt="Arcade Icon"
            />
          </div>
          <div className="ml-2">
            <div className="currency">ARCADE</div>
            <div className="chain small">Solana</div>
          </div>
        </div>

        <div className="d-flex  justify-content-center justify-content-center align-items-center p-3 gap-2">
          <div>
            <h1 className="text-white">{ArcadeTokenAccounts.xarcade}</h1>
          </div>
          <div className="polygon-circle" style={{backgroundColor:"none; !important"}}>
            <img 
              src="data:image/png;base64,"
              alt="Arcade Icon"
            />
          </div>
          <div className="ml-2">
            <div className="currency">ARCADE</div>
            <div className="chain small">Solana</div>
          </div>
        </div>
        <div
          className="d-flex justify-content-center"
          style={{ marginBottom: "3rem" }}
        >
          <h6>{balance.toFixed(4)} SOL</h6>
        </div>
        
      </div>
      <div className="accordion accordion-flush " id="rewardsID">
        <div className="accordion-item ">
          <h2 className="accordion-header" id="headingOnee">
            <button
              className="accordion-button second "
              type="button"
              data-bs-toggle="collapse"
              data-bs-target="#collapseOnee"
              aria-expanded="true"
              aria-controls="collapseOne"
            >
              Pending Rewards
            </button>
          </h2>
          <div
            id="collapseOnee"
            className="accordion-collapse collapse second"
            aria-labelledby="headingOnee"
            data-bs-parent="#rewardsID"
          >
            <div className="accordion-body">
              <a href="#">
                <h6 className="second">Pending Rewards</h6>
              </a>

            </div>
          </div>
        </div>
      </div>
      <div className="accordion accordion-flush " id="accordionExample">
        <div className="accordion-item ">
          <h2 className="accordion-header " id="headingOne">
            <button
              className="accordion-button  second "
              type="button"
              data-bs-toggle="collapse"
              data-bs-target="#collapseOne"
              aria-expanded="true"
              aria-controls="collapseOne"
            >
              My Missions
            </button>
          </h2>
          <div
            id="collapseOne"
            className="accordion-collapse collapse "
            aria-labelledby="headingOne"
            data-bs-parent="#accordionExample"
          >
            <div className="accordion-body second">
              <a href="#">
                <h6 className="second">My Missions</h6>
              </a>

              <div
                className="accordion accordion-flush "
                id="accordionExample2"
              >
                <div className="accordion-item ">

                  <div
                    id="collapseOne2"
                    className="accordion-collapse collapse "
                    aria-labelledby="headingOne2"
                    data-bs-parent="#accordionExample2"
                  >
                    <div className="accordion-body"></div>
                  </div>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
      <div className="accordion accordion-flush " id="accordionExample2">
        <div className="accordion-item ">
          <h2 className="accordion-header" id="sasHeading">
            <button
              className="accordion-button second "
              type="button"
              data-bs-toggle="collapse"
              data-bs-target="#sasCollapse"
              aria-expanded="true"
              aria-controls="sasCollapse"
            >
              Convert ARCADE to xARCADE
            </button>
          </h2>
          <div
            id="sasCollapse"
            className="accordion-collapse collapse second"
            aria-labelledby="sasHeading"
            data-bs-parent="#accordionExample2"
          >
            <div className="accordion-body">
            <DemoBalanceContext.Provider 
                value={{ ArcadeTokenAccounts, setArcadeTokenAccounts, currency, setCurrency, direction, setDirection, amount, setAmount }}
            >
                            <StepWizard>
                                <SAS t={t}/>
                                <SuccessSwap />
                            </StepWizard>
                            </DemoBalanceContext.Provider>

            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default SideWallet;
